<text onclick="window.location.replace('data.html')" transform="matrix(1 0 0 1 486.2592 106.4941)"><tspan x="0" y="0" class="st5 st2 st6">1.Range anxiety is a major concern for EV owners, </tspan><tspan x="-31.57" y="43.2" class="st5 st2 st6">as the distance an EV can travel on a single charge is </tspan><tspan x="-37.55" y="86.4" class="st5 st2 st6">often less than that of a traditional gas-powered car. </tspan><tspan x="-162.07" y="129.6" class="st5 st2 st6">However, advances in battery technology are making it possible for </tspan><tspan x="86.45" y="172.8" class="st5 st2 st6">EVs to travel farther on a single charge.</tspan><tspan x="-119.11" y="259.2" class="st5 st2 st6">2.EVs are generally cheaper to operate than gas-powered cars, </tspan><tspan x="-330.19" y="302.4" class="st5 st2 st6">as electricity is often less expensive than gasoline and EVs require less maintenance.</tspan><tspan x="-158.49" y="388.8" class="st5 st2 st6">3.Charging infrastructure is still a major hurdle for EV adoption, </tspan><tspan x="-87.07" y="432" class="st5 st2 st6">as there are far fewer charging stations than gas stations. </tspan><tspan x="50.43" y="475.2" class="st5 st2 st6">However, governments and private companies </tspan><tspan x="-174.6" y="518.4" class="st5 st2 st6">are investing in charging infrastructure to help alleviate this issue.</tspan><tspan x="-92.05" y="604.8" class="st5 st2 st6">4.EVs have a lower carbon footprint than gas-powered cars, </tspan><tspan x="-186.59" y="648" class="st5 st2 st6">but the sustainability of EVs depends on the source of the electricity </tspan><tspan x="9.95" y="691.2" class="st5 st2 st6">used to charge them. In areas where electricity is</tspan><tspan x="-227.09" y="734.4" class="st5 st2 st6"> generated from fossil fuels, the environmental benefit of EVs is reduced.</tspan><tspan x="-266.52" y="820.8" class="st5 st2 st6">5.The adoption of EVs is growing rapidly, with sales increasing year over year. </tspan><tspan x="133.95" y="864" class="st5 st2 st6">As battery technology improves and </tspan><tspan x="-251.08" y="907.2" class="st5 st2 st6">charging infrastructure expands, it is likely that more people will switch to </tspan><tspan x="-70.56" y="950.4" class="st5 st2 st6">electric vehicles as their primary mode of transportation.</tspan></text>

<script type="text/javascript">

let tooltip=document.querySelector('.tooltip')

// gets position of mouse on the page
function getpos(event) {
  var e = window.event;
  x = e.clientX ;
  y = e.clientY ;
} 

function updateTooltip(text_to_display){
  tooltip.innerHTML=text_to_display
  getpos()
  tooltip.style.opacity=1
  tooltip.style.left=x+30+"px"
  tooltip.style.top=y-30+"px"
}

function updateImgTooltip(img_to_display){
  tooltip.innerHTML=''
  tooltip.style.opacity=1
  picture = document.createElement('img')
  picture.src=img_to_display
  tooltip.appendChild(picture)
  getpos()
  tooltip.style.left=x+30+"px"
  tooltip.style.top=y-30+"px"
}

function clearTooltip() {
  tooltip.style.opacity=0
}

</script>
